import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M12 2a4 4 0 013.77 2.67 1 1 0 01-1.84.77l-.04-.1a2 2 0 00-3.88.51V8h7.74c1.2 0 2.17.93 2.24 2.1l.01.15v9.5c0 1.19-.93 2.16-2.1 2.24H6.25c-1.2 0-2.17-.92-2.24-2.09L4 19.75v-9.5c0-1.2.93-2.17 2.1-2.24L6.25 8H8V6a4 4 0 014-4zm0 11.5a1.5 1.5 0 100 3 1.5 1.5 0 000-3z", fill: primaryFill }));
};
const LockOpen24Filled = wrapIcon(rawSvg({}), 'LockOpen24Filled');
export default LockOpen24Filled;
